Check some source code "hello worlds" programs examples below: Bash #!/usr/bin/bash echo "Hello, world!" C #include <stdio.h> int main() { printf("Hello, world!"); return 0;
} C++ #include <iostream> int main() { std::cout << "Hello, world!"; return 0;
} C# namespace Greetings { class Hello { static void Main(string[] args) { System.Console.WriteLine("Hello World!"); } }
} Go package main import "fmt" func main() { fmt.Println("Hello, world!")
} Groovy println "Hello, World!" Java public class Greetings { public static void main(String[] args) { System.out.println("Hello, world!"); }
} Javascript console.log("Hello, world!"); Kotlin fun main(args : Array<String>) { println("Hello, world!")
} Perl #!/usr/bin/perl # Modules used
use strict;
use warnings; # Print function print("Hello World\n"); PHP <?php echo "Hello, world!";
?> Powershell Write-Host 'Hello, World!' Python print("Hello, world!") Ruby puts "Hello, world!"; Rust fn main() { println!("Hello, world!");
} Scala object Hello { def main(args: Array[String]) = { println("Hello, world!") }
} Typescript console.log("Hello, world!");
